!function(){var insights=angular.module("ngYTInsights",[]);insights.service("ngYTInsights",function($http,$q){function getChannelStats(channelname){var request=$http({method:"get",cache:!0,url:baseUrl+"channels?part=snippet,contentDetails,statistics&forUsername="+channelname+apikey});return request.then(handleSuccess,handleError)}function getChannelPlaylists(channelid){var request=$http({method:"get",cache:!0,url:baseUrl+"playlists?part=snippet&maxResults=50&channelId="+channelid+apikey});return request.then(handleSuccess,handleError)}function getPlaylistItems(playlistid){var request=$http({method:"get",cache:!0,url:baseUrl+"playlistItems?part=snippet&maxResults=50&playlistId="+playlistid+apikey});return request.then(handleSuccess,handleError)}function handleError(response){return angular.isObject(response.data)&&response.data.message?$q.reject(response.data.message):$q.reject("An unknown error occurred.")}function handleSuccess(response){return response.data}var baseUrl="https://www.googleapis.com/youtube/v3/",apikey="&key=AIzaSyCYwYrQTfWWYknZTnwHNLF0IhyUz-grzUw";return{getChannelStats:getChannelStats,getChannelPlaylists:getChannelPlaylists,getPlaylistItems:getPlaylistItems}})}();